import { createIcon } from "../icon/createIcon";

export const ChatGroupSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ChatGroupSolidIcon">
    <path d="M4.507 1a4.5 4.5 0 1 1-2.224 8.413L0 10.021l.401-2.677A4.5 4.5 0 0 1 4.507 1zm4.804 2.095a3.502 3.502 0 0 1 2.342 4.927L12 10l-1.806-.437a3.5 3.5 0 0 1-3.092.147 4.502 4.502 0 0 0 2.209-6.615z" />
  </svg>,
  "ChatGroupSolid",
  "chat group solid"
);
